#JIC - this yaml file describes the data that will be used for data analysis.
#       1)  Lists the columns to be included and in what order.
#       2)  Identifies the variables to be included in data analysis.
#       3)  Defines a mapping from text to numeral for text-based
#           variables. Some text variables are cateogircal, while others are
#           ordinal (in other words, continuous variables).
#       4)  Defines age groups for age normalization purposes.
#       5)  Lists dataset statistics for each variable to be used in the
#           normalization procedure.

time_interval: [0, 21600]

columns:
    include: [  'patient_id_encounter',
                'Variable Name',
                'Value',
                'Rate/Value',
                'Episode Start Timestamp',
                'Time of Day of Admission',
                'Pre ICU CPR',
                'Start Time',
                'Time of Administration',
                'End Time' ]
    renaming: { 'patient_id_encounter'              : 'eid',
                'patient_id'                        : 'pid',
                'Variable Name'                     : 'var_name',
                'Value'                             : 'value',
                'Rate/Value'                        : 'value',
                'End Time'                          : 'end_time',
                'Time of Administration'            : 'end_time',
                'Start Time'                        : 'start_time' }

age_groups:
    0-1 year: 0.0
    1-5 years: 1.0
    12-18 years: 12.0
    18+ years: 18.0
    5-8 years: 5.0
    8-12 years: 8.0

variables:
