        encoding: { 'Brain death'                                   : 1,
                    'Coma or vegetative state'                      : 2,
                    'Good overall performance'                      : 6,
                    'Mild overall disability'                       : 5,
                    'Moderate overall disability'                   : 4,
                    'Severe overall disability'                     : 3 }
